import {ufn_price_formatter, ufn_invoice_date_formatter} from "@/utils/ufn";

export default class UseInvoiceBuilder {
  constructor(data, type, date, setting) {
    this.setting = setting
    this.data = data
    this.type = type.value
    this.date = date.value
  }

  get invoice() {
    let contents = []
    let header = []
    let body = []
    this.data.forEach((project, i) => {
      header = this.setHeaders(project["name"], project["company_name"], project["styles"], project["tax"], project["tasks_total"])
      body = this.setBody(project["tasks"], project["styles"], project["tax"], project["tasks_total"])
      const information = this.setBankInformation()
      if (this.data.length === 1 && this.type === "御請求書") {
        contents.push(header[0], header[1], body, information)
      } else {
        body["pageBreak"] = "after"
        contents.push(header[0], header[1], body)
      }
    })
    return contents
  }

  setHeaders(project_name, company_name, styles, tax, total) {
    const title = {
      text: this.type,
      fontSize: styles["headerTitleFontSize"],
      margin: [0, 0, 0, 10]
    }

    const content = {
      columns: [
        {
          table: {
            headerRows: 1,
            widths: [30, 200],
            body: [
              [{
                text: "宛先",
                fontSize: styles["headerContentTextFontSize"]
              }, {
                text: company_name,
                fontSize: styles["headerContentTextFontSize"]
              }],
              [{
                text: "件名",
                fontSize: styles["headerContentTextFontSize"]
              }, {
                text: project_name,
                fontSize: styles["headerContentTextFontSize"]
              }],
              [{
                text: "日付",
                fontSize: styles["headerContentTextFontSize"]
              }, {
                text: this.date,
                fontSize: styles["headerContentTextFontSize"]
              }],
              [
                {
                  colSpan: 2,
                  text: "下記の通り" + this.type.substring(0, 3) + "申し上げます",
                  fontSize: styles["headerContentTextFontSize"],
                },
              ],
              [
                {
                  text: "",
                  border: [false, false, false, false]
                },
                {
                  table: {
                    margin: [20, 0, 0, 0],
                    widths: [70, 75],
                    body: [
                      [
                        {
                          text: this.type.substring(0, 3) + "金額",
                          border: [false, false, false, true],
                          alignment: "left",
                          fontSize: styles["headerContentTextFontSize"],
                        },
                        {
                          text: ufn_price_formatter((parseInt(total) + parseInt(tax))),
                          border: [false, false, false, true],
                          alignment: "right",
                          fontSize: styles["headerContentTextFontSize"],
                        },
                      ],
                    ]
                  },
                  border: [false, false, false, false],
                }

              ]
            ],
          },
          layout: {
            hLineWidth: function (i, node) {
              return (i === 0 || i === node.table.widths.length) ? 1 : 1;
            },
            vLineWidth: function (i, node) {
              return (i === 0 || i === node.table.widths.length) ? 0 : 0;
            },
            hLineColor: function (i, node) {
              return (i === 0 || i === node.table.widths.length) ? '#dcdde1' : '#dcdde1';
            },
          },
          width: 250,
        },
        {
          stack: [
            {
              text: 'reactive design',
              margin: [0, 0, 0, 3],
              fontSize: styles["headerBrandTextSize"],
            },
            {
              text: '株式会社リアクティブデザイン',
              margin: [0, 0, 0, 3],
              fontSize: styles["headerContentTextFontSize"],
            },
            '〒550-0002',
            '大阪府大阪市西区江戸堀1-22-17',
            '西船場辰巳ビル3F',
            {
              text: 'TEL: 06-6225-7444',
              margin: [0, 5, 0, 0]
            },
            'FAX: 06-6225-7445',
            '登録番号: T4120001146495',
          ],
          fontSize: styles["headerContentTextFontSize"],
          margin: [10, 0, 0, 0],
          width: 180,
        },
        {
          image: 'data:image/png;base64,',
          fit: [75, 75],
          margin: [0, 25, 0, 0]
        },
      ],
    }
    return [title, content]
  }

  setBody(tasks, styles, tax, total) {
    let rows = []
    const th = [
      {
        text: "項目",
        border: [false, true, true, true],
        alignment: "center",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "数量",
        border: [true, true, true, true],
        alignment: "center",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "単位",
        border: [true, true, true, true],
        alignment: "center",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "単価",
        border: [true, true, true, true],
        alignment: "center",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "金額",
        border: [true, true, false, true],
        alignment: "center",
        fontSize: styles["bodyContentFontSize"],
      },
    ]
    const td = [
      {
        text: "＜公式サイト＞",
        border: [false, true, true, true],
        alignment: "left",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "",
        border: [true, true, true, true],
        alignment: "center",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "",
        border: [true, true, true, true],
        alignment: "center",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "",
        border: [true, true, true, true],
        alignment: "center",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "",
        border: [true, true, false, true],
        alignment: "center",
        fontSize: styles["bodyContentFontSize"],
      },
    ]
    rows.push(th, td)
    tasks.forEach((task, i) => {
      const td = [
        {
          text: "",
          border: [false, true, true, true],
          alignment: "left",
          fontSize: styles["bodyContentFontSize"],
          columns: [
            {
              text: task["task_name"],
              width: 265
            },
            {
              text: ufn_invoice_date_formatter(task["task_invoice_date"]),
              width: 35,
              alignment: "center"
            },
          ]
        },
        {
          text: task["task_count"],
          border: [true, true, true, true],
          alignment: "center",
          fontSize: styles["bodyContentFontSize"],
        },
        {
          text: task["task_kind"],
          border: [true, true, true, true],
          alignment: "center",
          fontSize: styles["bodyContentFontSize"],
        },
        {
          text: task["task_price"] ? ufn_price_formatter(task["task_price"]) : "",
          border: [true, true, true, true],
          alignment: "center",
          fontSize: styles["bodyContentFontSize"],
        },
        {
          text: task["task_total_price"] ? ufn_price_formatter(task["task_total_price"]) : "",
          border: [true, true, false, true],
          alignment: "right",
          fontSize: styles["bodyContentFontSize"],
        }
      ]
      rows.push(td)
    })

    const footers = this.setFooter(styles, tax, total)
    rows.push(footers[0], footers[1], footers[2])

    const len = rows.length
    const relen = len - 3

    /* body with styles */
    return {
      table: {
        headerRows: 1,
        widths: [300, 20, 30, 50, 60],
        body: rows
      },
      layout: {
        hLineWidth: function (i, node) {
          return (i === 1 || i === relen) ? 2 : 1;
        },
        hLineColor: function (i, node) {
          return (i === 1 || i === relen) ? 'black' : '#dcdde1';
        },
        vLineColor: function (i, node) {
          return (i === 0 || i === node.table.widths.length) ? '#dcdde1' : '#dcdde1';
        },
      },
      margin: [0, 15, 0, 0],
      // pageBreak: "after",
    }
  }

  setFooter(styles, tax, total) {
    const row1 = [
      {
        text: "",
        border: [false, true, true, true],
        alignment: "left",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "小計",
        border: [true, true, false, true],
        alignment: "left",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "",
        border: [false, true, false, true],
        alignment: "center",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "",
        border: [false, true, false, true],
        alignment: "center",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: ufn_price_formatter(total),
        border: [true, true, false, true],
        alignment: "right",
        fontSize: styles["bodyContentFontSize"],
      }
    ]
    const row2 = [
      {
        text: "",
        border: [false, true, true, true],
        alignment: "left",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "消費税 (10%)",
        border: [true, true, false, true],
        alignment: "left",
        colSpan: 3,
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "",
        border: [false, true, false, true],
        alignment: "center",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "",
        border: [false, true, false, true],
        alignment: "center",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: ufn_price_formatter(tax),
        border: [true, true, false, true],
        alignment: "right",
        fontSize: styles["bodyContentFontSize"],
      }
    ]
    const row3 = [
      {
        text: "",
        border: [false, true, true, true],
        alignment: "left",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: this.type.substring(0, 3) + "金額",
        border: [true, true, false, true],
        colSpan: 2,
        alignment: "left",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "",
        border: [false, true, false, true],
        alignment: "center",
        colSpan: 2,
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: "",
        border: [false, true, false, true],
        alignment: "center",
        fontSize: styles["bodyContentFontSize"],
      },
      {
        text: ufn_price_formatter((parseInt(total) + parseInt(tax))),
        border: [true, true, false, true],
        alignment: "right",
        fontSize: styles["bodyContentFontSize"],
      }
    ]
    return [row1, row2, row3]
  }

  setBankInformation() {
    console.log(this.setting)
    return {
      table: {
        widths: [420],
        body: [
          [
            {
              text: this.setting.invoice_text1,
              fontSize: 10, alignment: 'left',
              paddingTop: 2,
              paddingBottom: 2,
              border: [false, false, false, false],
            },
          ],
          [
            {
              text: this.setting.invoice_text2,
              fontSize: 10, alignment: 'left',
              paddingTop: 2,
              paddingBottom: 2,
              border: [false, false, false, false],

            },
          ],
          [
            {
              text: this.setting.invoice_text3,
              fontSize: 10, alignment: 'left',
              paddingTop: 2,
              paddingBottom: 2,
            }
          ],
        ],
      },
      layout: {
        defaultBorder: false,
        paddingTop: function (i, node) {
          return 0;
        },
        paddingBottom: function (i, node) {
          return 0;
        },
      },
      margin: [0, 25, 0, 0],

    }
  }

}